import{_ as p,c as _,o as t,a as e}from"./app.27be4722.js";const T='{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"poem/\u585E\u5C14\u7EF4\u4E9A\u56FD\u6B4C.md"}',o={},a=e("<p><strong>\u585E\u5C14\u7EF4\u4E9A\u56FD\u6B4C\u6B4C\u8BCD</strong></p><p>\u200B 1872\u5E74 Jovan Dordevic</p><p>\u6B63\u4E49\u7684\u4E0A\u5E1D\uFF0C\u4F60\u66FE\u5728\u6700\u6DF1\u53D7\u56F0\u82E6\u65F6\u62EF\u6551\u4E86\u6211\u4EEC\u3002</p><p>\u8BF7\u542C\u4F60\u5B50\u6C11\u7684\u58F0\u97F3\uFF0C\u50CF\u5F80\u6614\u90A3\u6837\u4F5C\u6211\u4EEC\u7684\u63F4\u52A9\uFF01</p><p>\u6709\u4F60\u5168\u80FD\u7684\u624B\u7EF4\u6301\u6211\u4EEC,\u94FA\u5E73\u5D0E\u5C96\u7684\u8DEF\u5F84\u3002</p><p>\u4E0A\u4E3B\uFF0C\u6211\u4EEC\u7684\u5E0C\u671B\uFF0C\u613F\u4F60\u4FDD\u4F51\u770B\u987E\u585E\u5C14\u7EF4\u4E9A\u7684\u571F\u5730\u548C\u4EBA\u6C11\uFF01</p><p>\u6C42\u4F60\u628A\u6211\u4EEC\u7684\u540C\u80DE\u7D27\u7D27\u56E2\u7ED3\u5728\u4E00\u8D77\uFF0C\u6559\u6211\u4EEC\u4EE5\u4E0D\u673D\u7684\u7231\u3002</p><p>\u613F\u90A3\u4E0D\u548C\u7684\u6076\u9B54\u6C38\u4E0D\u5728\u6211\u4EEC\u4E2D\u95F4\u5F97\u901E\uFF01</p><p>\u8BA9\u56E2\u7ED3\u7684\u4E30\u7855\u679C\u5B9E\uFF0C\u4E3A\u6211\u4EEC\u5E74\u8F7B\u7684\u81EA\u7531\u4E4B\u6811\u589E\u6DFB\u5149\u5F69\u3002</p><p>\u4E0A\u4E3B\uFF0C\u6211\u4EEC\u7684\u4E3B\u5BB0\uFF01\u613F\u4F60\u5E26\u9886\u7E41\u8363\u585E\u5C14\u7EF4\u4E9A\u7684\u571F\u5730\u548C\u4EBA\u6C11\uFF01</p><p>\u4E3B\u554A\uFF01\u6C42\u4F60\u514D\u6211\u4EEC\u4E8E\u4F60\u7684\u62A5\u590D\uFF0C\u7531\u4F60\u53EF\u6015\u7684\u5FFF\u6012\u6240\u53D1\u7684\u96F7\u9706\u3002</p><p>\u6C42\u4F60\u5E87\u62A4\u585E\u5C14\u7EF4\u4E9A\u6BCF\u4E00\u5EA7\u57CE\u5E02\u6751\u843D\uFF0C\u4E00\u5207\u5C71\u5CF0\u3001\u8349\u539F\u548C\u6240\u6709\u751F\u7075\u3002</p><p>\u5F53\u4EC7\u654C\u6765\u88AD\u65F6\uFF0C\u6211\u4EEC\u8981\u4E48\u80DC\u5229\uFF0C\u8981\u4E48\u6B7B\u53BB\u3002</p><p>\u4E07\u519B\u7684\u4E0A\u4E3B\uFF01\u4F5C\u6211\u4EEC\u7684\u9886\u8896\uFF0C\u53CA\u65F6\u632F\u594B\u585E\u5C14\u7EF4\u4E9A\u6C11\u65CF\uFF01</p><p>\u5728\u6211\u4EEC\u53E4\u8001\u7684\u575F\u5893\u4E2D\uFF0C\u751F\u51FA\u590D\u6D3B\u7684\u826F\u8FB0\uFF0C</p><p>\u81EA\u6700\u60B2\u60E8\u5974\u5F79\u7684\u6CE5\u6F6D\u4E2D\uFF0C\u585E\u5C14\u7EF4\u4E9A\u91CD\u751F\u4E86\uFF01</p><p>\u6211\u4EEC\u5728\u8FD9\u4E94\u767E\u5E74\u7684\u56DA\u7981\u4E2D\uFF0C\u5728\u4F60\u9762\u524D\u4E0B\u8DEA\u3002</p><p>\u4E0A\u4E3B\uFF0C\u6211\u4EEC\u7684\u4E3B\u5BB0\uFF01\u8BF7\u4F60\u6307\u5F15\u7E41\u8363\uFF0C\u8FD9\u662F\u585E\u5C14\u7EF4\u4E9A\u4EBA\u6C11\u7684\u6073\u6C42\uFF01</p>",18),r=[a];function s(c,n,i,d,l,f){return t(),_("div",null,r)}var h=p(o,[["render",s]]);export{T as __pageData,h as default};
